static NSPersistentStoreCoordinator* persistentStoreCoordinator(NSString* serviceName)
{
    assert([NSThread isMainThread]);
    static NSMutableDictionary* __persistentStoreCoordinatorCache = nil;
    NSPersistentStoreCoordinator* __persistentStoreCoordinator;
    
    if (__persistentStoreCoordinatorCache != nil)
    {
        __persistentStoreCoordinator = [__persistentStoreCoordinatorCache objectForKey:serviceName];
        
        if (__persistentStoreCoordinator != nil)
        {
            return __persistentStoreCoordinator;
        }
    }
    else
    {
        __persistentStoreCoordinatorCache = [NSMutableDictionary new];
    }
    
    NSURL *storeURL = nil;
    if ([serviceName isEqualToString:@"news"])
    {
        NSString* _lastPathComponent = [NSString stringWithFormat:@"%@.sqlite", _str_i_smrt_news()];
#if DEBUG
        assert([@"iSmartNews.sqlite" isEqualToString:_lastPathComponent]);
#endif
        storeURL = [dataBaseDir() URLByAppendingPathComponent:_lastPathComponent];
    }
    else
    {
        NSString* _lastPathComponent = [NSString stringWithFormat:@"%@_%@.sqlite",_str_i_smrt_news(), serviceName];
        storeURL = [dataBaseDir() URLByAppendingPathComponent:_lastPathComponent];
    }
    
    NSError *error = nil;
    __persistentStoreCoordinator = [[NSPersistentStoreCoordinator alloc] initWithManagedObjectModel:managedObjectModel()];
    if (![__persistentStoreCoordinator addPersistentStoreWithType:NSSQLiteStoreType configuration:nil URL:storeURL options:nil error:&error])
    {
        __persistentStoreCoordinator = nil;
        [[NSFileManager defaultManager] removeItemAtURL:storeURL error:nil];
        
        __persistentStoreCoordinator = [[NSPersistentStoreCoordinator alloc] initWithManagedObjectModel:managedObjectModel()];
        if (![__persistentStoreCoordinator addPersistentStoreWithType:NSSQLiteStoreType configuration:nil URL:storeURL options:nil error:&error])
        {
            __persistentStoreCoordinator = nil;
            iSmartNewsLog(@"Unresolved error %@, %@", error, [error userInfo]);
        }
    }
    
    if (__persistentStoreCoordinator)
    {
        [__persistentStoreCoordinatorCache setObject:__persistentStoreCoordinator forKey:serviceName];
    }
    
    return __persistentStoreCoordinator;
}


NSManagedObjectContext* managedObjectContext(NSString* serviceName)
{
    assert([NSThread isMainThread]);
    NSManagedObjectContext* managedObjectContext;
    static NSMutableDictionary* __managedObjectContextCache = nil;
    if (__managedObjectContextCache)
    {
        managedObjectContext = [__managedObjectContextCache objectForKey:serviceName];
        if (managedObjectContext != nil)
        {
            return managedObjectContext;
        }
    }
    else
    {
        __managedObjectContextCache = [NSMutableDictionary new];
    }
    
    NSPersistentStoreCoordinator *coordinator = persistentStoreCoordinator(serviceName);
    if (coordinator != nil)
    {
        managedObjectContext = [[NSManagedObjectContext alloc] initWithConcurrencyType:NSMainQueueConcurrencyType];
        [managedObjectContext setPersistentStoreCoordinator:coordinator];
        [__managedObjectContextCache setObject:managedObjectContext forKey:serviceName];
    }

    return managedObjectContext;
}

