    NSString* currentVersion = [[NSBundle mainBundle] objectForInfoDictionaryKey:@"CFBundleVersion"];
    NSString* versionOfLastRun = [[NSUserDefaults standardUserDefaults] objectForKey:@"SNVersionOfLastRun"];
    
    if (versionOfLastRun == nil) {
        // First start after installing the app
    } else if (![versionOfLastRun isEqual:currentVersion]) {
        // App was updated since last run
        [[NSUserDefaults standardUserDefaults] setBool:YES forKey:@"SNUpgrade"];
        g_AppUpgradeDone = YES;
        g_isUpgrade = YES;
    } else {
        // nothing changed
    }
    
    [[NSUserDefaults standardUserDefaults] setObject:currentVersion forKey:@"SNVersionOfLastRun"];
    [[NSUserDefaults standardUserDefaults] synchronize];
}

static INLINE_INTERNAL_ATTRIBUTES BOOL sn_isUpgrade()
{
    sn_detectUpgrade(NO);
    return g_isUpgrade;
}

