static NSArray* shuffleArray(NSArray* arr)
{
    NSMutableArray* c = [arr mutableCopy];
    NSUInteger count = [c count];
    if (count < 1) return [c copy];
    for (NSUInteger i = 0; i < count - 1; ++i) {
        NSInteger remainingCount = count - i;
        NSInteger exchangeIndex = i + arc4random_uniform((u_int32_t )remainingCount);
        [c exchangeObjectAtIndex:i withObjectAtIndex:exchangeIndex];
    }
    return [c copy];
}

- (NSUInteger)_dayIntervalSinceDate:(NSDate*)sinceDate
{
    if (!sinceDate)
        return 0;
    
    NSCalendar* currentCalendar = [NSCalendar currentCalendar];
    
    const NSCalendarUnit units = NSCalendarUnitYear|NSCalendarUnitMonth|NSCalendarUnitDay;
    
    NSDateComponents* selfComponents = [currentCalendar components:units fromDate:[NSDate ism_date]];
    NSDateComponents* sinceComponents = [currentCalendar components:units fromDate:sinceDate];
    
    selfComponents.hour = 0;
    selfComponents.minute = 0;
    selfComponents.second = 0;
    
    sinceComponents.hour = 0;
    sinceComponents.minute = 0;
    sinceComponents.second = 0;
    
    const NSTimeInterval t = fabs([[currentCalendar dateFromComponents:selfComponents] timeIntervalSinceDate:[currentCalendar dateFromComponents:sinceComponents]])/(3600.0 * 24.);
    return (NSUInteger)t;
}

- (NSUInteger)_hourIntervalSinceDate:(NSDate*)sinceDate
{
    if (!sinceDate)
        return 0;
    
    NSCalendar* currentCalendar = [NSCalendar currentCalendar];
    
    const NSCalendarUnit units = NSCalendarUnitYear|NSCalendarUnitMonth|NSCalendarUnitDay|NSCalendarUnitHour|NSCalendarUnitMinute;
    
    NSDateComponents* selfComponents = [currentCalendar components:units fromDate:[NSDate ism_date]];
    NSDateComponents* sinceComponents = [currentCalendar components:units fromDate:sinceDate];
    
    selfComponents.minute = 0;
    selfComponents.second = 0;
    
    sinceComponents.minute = 0;
    sinceComponents.second = 0;
    
    const NSTimeInterval t = fabs([[currentCalendar dateFromComponents:selfComponents] timeIntervalSinceDate:[currentCalendar dateFromComponents:sinceComponents]])/(3600.0);
    return (NSUInteger)t;
}

- (BOOL)checkAllowedForAnotherConditions
{
    return ([self.notPresented boolValue] == NO);
}

- (BOOL)checkAllowedForInstall
{
    if (![[self oncePerInstall] boolValue])
    {
        return YES;
    }
    
    return ![[self oncePerInstallShown] boolValue];
}

- (BOOL)checkAllowedForVersion
{
    if ([[self showOnlyIfUpgrade] boolValue])
    {
        if (!sn_isUpgrade())
        {
            return NO;
        }
    }
    
    if (![[self oncePerVersion] boolValue])
    {
        return YES;
    }
    
    NSDictionary* infoDictionary = [[NSBundle mainBundle] infoDictionary];
    
    NSString* appVersion = [infoDictionary objectForKey:@"CFBundleVersion"];
    
    // Special case for items containing oncePerVersionCondition with 'review'.
    // It should be not shown if some other item was closed in this version with 'review' condition.
    if ([[self uuid] isEqualToString:@"review"])
    {
        NSFetchRequest* fetchRequest = [NSFetchRequest fetchRequestWithEntityName:[self.entity name]];
        [fetchRequest setPredicate:[NSPredicate predicateWithFormat:@"(uuid != %@) AND (shownInVersion == %@) AND (shownInVersionCondition == %@)",
                                    [self uuid],
                                    appVersion,
                                    @"review"]];
        
        if ([[self.managedObjectContext executeFetchRequest:fetchRequest error:NULL] count] > 0)
        {
            return NO;
        }
    }
    
    if (![self shownInVersion])
    {
        return YES;
    }
    
    if ([[self shownInVersion] isEqualToString:appVersion])
    {
        iSmartNewsLog(@"checkAllowedForVersion - fail: %@, currentv = %@", [self uuid], appVersion);
        return NO;
    }
    
    return YES;
}

- (BOOL)checkMinShowInterval
{
    if (![self lastShown])
    {
        return YES;
    }
    
    NSString* interval = [self minShowInterval];
    if (!interval){
        return YES;
    }
    
    if ([interval isEqualToString:@"hour"]){
        if ([self _hourIntervalSinceDate:[self lastShown]] == 0){
            return NO;
        }
    }
    else if ([interval isEqualToString:@"day"]){
        if ([self _dayIntervalSinceDate:[self lastShown]] == 0){
            return NO;
        }
    }
    else if ([interval isEqualToString:@"week"]){
        if ([self _dayIntervalSinceDate:[self lastShown]] < 7){
            return NO;
        }
    }
    else {
        const NSInteger seconds = [interval integerValue];
        if (seconds > 0 && ([[NSDate ism_date] timeIntervalSinceDate:[self lastShown]] < seconds)){
            return NO;
        }
    }
    
    return YES;
}


- (void)randomizeUrlsAndSequence
{
    if (![[self randomize] boolValue]){
        return;
    }

    NSMutableArray* urlComponents = [[[self valueForKey:@"urlsSrc"] componentsSeparatedByString:@"!!!"] mutableCopy];
    NSMutableArray* seqComponents  = [self valueForKey:@"sequenceSrc"] ? [[[self valueForKey:@"sequenceSrc"] componentsSeparatedByString:@"|"] mutableCopy] : nil;
    
    if (!seqComponents)
    {
        [self setValue:[shuffleArray(urlComponents) componentsJoinedByString:@"!!!"] forKey:@"urls"];
    }
    else
    {
        NSMutableArray* randomizedSeqComponents = [NSMutableArray new];
        while ([seqComponents count] != 0)
        {
            NSUInteger n = 0;
            
            if ([seqComponents count] >= [urlComponents count])
            {
                n = [urlComponents count];
            }
            else
            {
                n = [seqComponents count];
            }

            if (n == 1)
            {
                [randomizedSeqComponents addObject:[seqComponents firstObject]];
                [seqComponents removeObjectAtIndex:0];
            }
            else
            {
                [randomizedSeqComponents addObjectsFromArray:shuffleArray([seqComponents subarrayWithRange:NSMakeRange(0,n)])];
                [seqComponents removeObjectsInRange:NSMakeRange(0,n)];
            }
        }
        [self setValue:[shuffleArray(randomizedSeqComponents) componentsJoinedByString:@"|"] forKey:@"sequence"];
    }
}

